EXEC('
BEGIN
DECLARE @IDLoja as bigint
SELECT @IDLoja = ID FROM [tbLojas] 
DELETE FROM [dbo].[tbMapasVistas] WHERE ID=36
SET IDENTITY_INSERT [dbo].[tbMapasVistas] ON 
INSERT [dbo].[tbMapasVistas] ([ID], [Ordem], [Entidade], [Descricao], [NomeMapa], [Caminho], [Certificado], [MapaXML], [IDModulo], [IDSistemaTipoDoc], [IDSistemaTipoDocFiscal], [IDLoja], [SQLQuery], [Tabela], [Geral], [Listagem], [Ativo], [Sistema], [DataCriacao], [UtilizadorCriacao], [DataAlteracao], [UtilizadorAlteracao]) VALUES (36, 36, N''Receita'', N''Receita'', N''rptReceita1'', N''\Reporting\Reports\Oticas\DocumentosVendas\'', 0, NULL, NULL, NULL, NULL, @IDLoja, N''select c.nome as DescricaoCliente, m.Nome as DescricaoMedicoTecnico, m.Observacoes as DadosMedicoTecnico, c.NContribuinte as NContribuinte, c.NumeroBeneficiario1 as NumeroBeneficiario1, c.NumeroBeneficiario2 as NumeroBeneficiario2, c.Codigo as CodigoCliente, e1.codigo as CodigoEntidade1, e2.codigo as CodigoEntidade2,e.Descricao as DescricaoEspecialidade, x.* from vwExamesProps x left join tbClientes c on x.idcliente=c.id left join tbMedicosTecnicos m on x.idmedicotecnico=m.id left join tbEspecialidades e on x.IDespecialidade=e.id left join tbEntidades e1 on c.identidade1=e1.id left join tbEntidades e2 on c.identidade2=e2.id'', NULL, 0, 0, 1, 1, CAST(N''2017-01-31 00:00:00.000'' AS DateTime), N''F3M'', CAST(N''2017-01-17 16:58:42.120'' AS DateTime), N'''')
SET IDENTITY_INSERT [dbo].[tbMapasVistas] OFF
END')


